import React, { useEffect, useRef } from "react";
import ITyped from "react-ityped";

const About = () => {
    const strings = ["Startups", "SMEs"];

    return (
        <div className="relative text-center w-40/50 ml-auto mr-auto ">
            <h2>Hello I'm Nwaose victor </h2>
            <h1 className="text-7xl font-sans text-left font-bold leading-10">
                I build visually appealing websites and softwares for
            </h1>
            <ITyped
                className="container ityped-cursor"
                showCursor={false}
                strings={strings}
                typeSpeed={500}
                backSpeed={500}
                startDelay={500}
                backDelay={900}
            />
        </div>
    );
};

export default About;
